import React, { useState } from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';

const SignUpForm = () => {
  const [isSubmitted, setIsSubmitted] = useState(false);

  // Validation schema
  const validationSchema = Yup.object({
    userType: Yup.string().required('User type is required'),
    firstName: Yup.string().min(2, 'Too short').required('First name is required'),
    lastName: Yup.string().min(2, 'Too short').required('Last name is required'),
    email: Yup.string().email('Invalid email address').required('Email is required'),
    mobile: Yup.string()
      .matches(/^[0-9]{11}$/, 'Mobile number must be 11 digits')
      .required('Mobile number is required'),
    password: Yup.string().min(6, 'Password too short').required('Password is required'),
    confirmPassword: Yup.string()
      .oneOf([Yup.ref('password'), null], 'Passwords must match')
      .required('Please confirm your password'),
    recaptcha: Yup.boolean().oneOf([true], 'Recaptcha is required'),
  });

  const formik = useFormik({
    initialValues: {
      userType: '',
      firstName: '',
      lastName: '',
      email: '',
      mobile: '',
      password: '',
      confirmPassword: '',
      recaptcha: false,
    },
    validationSchema,
    onSubmit: (values) => {
      setIsSubmitted(true);
      console.log(values);
    },
  });

  return (
    <div className="signup-container">
      <form onSubmit={formik.handleSubmit} className="signup-form">
        <h2>Register Your Account</h2>
        <p>New user? Please fill in your information. We promise you only have to do this once.</p>
        <div className="form-row">
          <label htmlFor="userType">User Type *</label>
          <select
            id="userType"
            name="userType"
            onChange={formik.handleChange}
            value={formik.values.userType}
          >
            <option value="">Select User type</option>
            <option value="Buyer">Buyer</option>
            <option value="Seller">Seller</option>
            <option value="Agent">Agent</option>
          </select>
          {formik.errors.userType && <div className="error">{formik.errors.userType}</div>}
        </div>

        <div className="form-row">
          <label htmlFor="firstName">First Name *</label>
          <input
            id="firstName"
            name="firstName"
            type="text"
            onChange={formik.handleChange}
            value={formik.values.firstName}
          />
          {formik.errors.firstName && <div className="error">{formik.errors.firstName}</div>}
        </div>

        <div className="form-row">
          <label htmlFor="lastName">Last Name *</label>
          <input
            id="lastName"
            name="lastName"
            type="text"
            onChange={formik.handleChange}
            value={formik.values.lastName}
          />
          {formik.errors.lastName && <div className="error">{formik.errors.lastName}</div>}
        </div>

        <div className="form-row">
          <label htmlFor="email">Email *</label>
          <input
            id="email"
            name="email"
            type="email"
            onChange={formik.handleChange}
            value={formik.values.email}
          />
          {formik.errors.email && <div className="error">{formik.errors.email}</div>}
        </div>

        <div className="form-row">
          <label htmlFor="mobile">Mobile *</label>
          <input
            id="mobile"
            name="mobile"
            type="text"
            onChange={formik.handleChange}
            value={formik.values.mobile}
          />
          {formik.errors.mobile && <div className="error">{formik.errors.mobile}</div>}
        </div>

        <div className="form-row">
          <label htmlFor="password">Password *</label>
          <input
            id="password"
            name="password"
            type="password"
            onChange={formik.handleChange}
            value={formik.values.password}
          />
          {formik.errors.password && <div className="error">{formik.errors.password}</div>}
        </div>

        <div className="form-row">
          <label htmlFor="confirmPassword">Confirm Password *</label>
          <input
            id="confirmPassword"
            name="confirmPassword"
            type="password"
            onChange={formik.handleChange}
            value={formik.values.confirmPassword}
          />
          {formik.errors.confirmPassword && (
            <div className="error">{formik.errors.confirmPassword}</div>
          )}
        </div>

        <div className="form-row">
          <label>
            <input
              id="recaptcha"
              name="recaptcha"
              type="checkbox"
              onChange={formik.handleChange}
              checked={formik.values.recaptcha}
            />
            I'm not a robot
          </label>
          {formik.errors.recaptcha && <div className="error">{formik.errors.recaptcha}</div>}
        </div>

        <button type="submit" className="signup-btn">
          Sign Up
        </button>

        {isSubmitted && <div className="success">Form submitted successfully!</div>}

        <div className="login-link">
          Already Registered User? <a href="#login">Login</a>
        </div>
      </form>
    </div>
  );
};

export default SignUpForm;
